import React from "react";
import { Route } from "react-router-dom";
import {AllMeetups, NewMeetup, Favorites} from './index'

export default function App ()
{
  return (
    <div>
      <h1>My Todo</h1>
      <Route path='/'>
      <AllMeetups />
      </Route>
      <Route path='/new-meetup'>
      <NewMeetup />
      </Route>
      <Route path='/favorites'>
      <Favorites />
      </Route>
    </div>
  );
}
